// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Modifires{

    uint num;
    address owner;
    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(owner == msg.sender);
        _;
    }

    function add(uint _num) public onlyOwner {
        num += _num;
    }

    function subtract(uint _num) public onlyOwner {
        num -= _num;
    }
}

